    [2, 5, 6]
    >>> get_positive([5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10])
    [5, 3, 2, 3, 9, 123, 1]
    """
    if l is None:
        return []
    elif len(l) == 0:
        return []
    else:
        return [int(x) for x in l if x is not None]

